import { Container, Grid } from 'semantic-ui-react';
import Sources from '../components/SourceList/Sources';

class Blog extends Component {
render() {
   return (
    <div>
<Container>

   <Grid container columns={3}>

   <Grid.Row>
    <Grid.Column>
      OK
    </Grid.Column>
   </Grid.Row> 

   <Grid.Row>
    <Grid.Column>
      I See
    </Grid.Column>
   </Grid.Row> 

   <Grid.Row>
    <Grid.Column>
      Fine, Bye
    </Grid.Column>
   </Grid.Row> 

  </Grid>

 </Container>

  </div>
        )
    }
}

export default Blog;
